import Header from "./components/Header";
import './css/main.css';
import BodyStart from "./components/BodyStart";
import BodyAboutMe from "./components/bodyAboutMe";
import BodySkills from "./components/bodySkills";

class App extends React.Component { 
  render() {
    return (
      <div>
        
        <Header Name="Ciornii Andrei" />

        <BodyStart background="https://content.r9cdn.net/rimg/dimg/61/8e/45db2363-city-12658-16510570590.jpg?crop=true&width=1366&height=768&xhint=1926&yhint=1698"
        myPhoto="https://i.ibb.co/bs7FpT6/cvphoto.png"
        name="Ciornii Andrei"
        role="UI-Designer and front-end developer"
        inst="https://www.instagram.com/leankey.exe/"
        telegram="https://t.me/leankey"
        github="https://github.com/leankey"
        linkedin=""/>
        <div className="content-container">


       
        <BodyAboutMe 
         AboutMeDescription="Hello! I'm Andrei Ciornii, a UI Designer and front-end developer. I'm dedicated to honing my craft and have excellent interpersonal skills. I'm proficient in Photoshop, a valuable tool in my arsenal. With my fast learning abilities, I am prepared to be an efficient and promising asset to any company."
         age="18"
         email="ciorniiandrei373@gmail.com"
         phone="+37379806599"
         adress="Moldova, Chisinau"
         />

         
      <BodySkills className="container"></BodySkills>

       

        </div>
      </div>
    );
  }
}

export default App;
